import Head from 'next/head'

import Navbar from './Navbar'

const Layout = (props) => (
  <>
  <Head>
    <title>SuperHero</title>    
    <link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootstrap/4.4.1/css/bootstrap.min.css"/>
  
    <style jsx> {`
      @font-face {
        font-family: 'PT Sans';
        src: url('../public/static/fonts/PTSans-Regular.ttf');
        src: url('../public/static/fonts/PTSans-Italic.ttf');
        src: url('../public/static/fonts/PTSans-BoldItalic.ttf');
        src: url('../public/static/fonts/PTSans-Bold.ttf');
      }

      body {
        font-family: 'PT Sans', sans-serif;
      }
    `}
  </style>
  
  
  
  </Head>
  <Navbar/>
  {props.children}
  </>
)

export default Layout;
